var Glob=require("../glob.js").Glob;var test=require("tap").test;test("globstar should not have dupe matches",function(d){var c="a/**/[gh]";var a=new Glob(c,{cwd:__dirname});var b=[];a.on("match",function(e){console.error("match %j",e);b.push(e)});a.on("end",function(e){console.error("set",e);b=b.sort();e=e.sort();d.same(b,e,"should have same set of matches");d.end()})});